import React from "react";
import "../styles/Home.css";

function Home() {
  const chapters = [
    { number: 1, title: "Curious Beginnings", desc: "Started exploring digital art, colors, and aesthetics." },
    { number: 2, title: "First Lines of Code", desc: "Wrote my first HTML and CSS page." },
    { number: 3, title: "Bano Qabil Incubator", desc: "Joined real learning. Built actual projects." },
    { number: 4, title: "Balancing O-Levels", desc: "Managed my studies and web development together." },
    { number: 5, title: "Live Projects", desc: "Worked with real clients and improved my skills." },
    { number: 6, title: "Now", desc: "Building polished, animated, hire-worthy frontends." },
  ];

  return (
    <section className="storyline-section">
      <h2 className="story-heading">My Journey as a Dream Chaser</h2>
      <div className="timeline-container">
        {chapters.map((chapter) => (
          <div key={chapter.number} className="timeline-item">
            <div className="chapter-dot">{chapter.number}</div>
            <div className="hover-description">{chapter.title}<span>{chapter.desc}</span></div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Home;
